  input: TEXT,"F3XA","","This response is in regard to your correspondence dated July
    31, 2002 citing the Amended May Monthly Report (4/1/02 to 4/30/02) for Dedicated
    Americans for the Senate and the House PAC (DASHPAC).  Specifically, in regard
    to Lines 21 (a)(i) and 21(a)(ii) of the Detailed Summary Page, an updated version
    of our electronic filing software now allows us to report all Schedule H4 transactions,
    regardless of threshold.  As a result, this amendment itemizes all Schedule H4
    transactions for your review and the sum of all entries itemized is equal to the
    totals on the Detailed Summary Page.  In reference to the missing Schedule H2,
    a data entry error allowed for the omission of this schedule.  This data entry
    error has been corrected and is Schedule H2 is now filed in this amendment.  Finally,
    in reference to the event year-to-date calculations for Administrative/Voter Drive
    and General Fundraising, the totals within a specific event (i.e. administrative
    or general fundraising) are correct.  However, the reporting software we use does
    not calculate a running event year-to-date total but rather a total calculation
    for the specific event.  Therefore, the aggregate number you see is a reflection
    of the total for that specific event.  I trust the above explanations satisfy
    the issues you have raised in your correspondence.  Should you have any additional
    questions or concerns, please do not hesitate to contact the committee at (202)
    546-0381."
